import React from "react";
import Button from "./Button";
import Card from "./Card";
import styles from "./ErrorModal.module.css";

function ErrorModal(props) {
  return (
    <Card>
      <header>
        <h2>props.title</h2>
      </header>
      <div>
        <p></p>
      </div>
      <footer>
        <Button></Button>
      </footer>
    </Card>
  );
}

export default ErrorModal;
